import React from "react";
import Container from "react-bootstrap/Container";
import Button from "react-bootstrap/Button";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Image from "react-bootstrap/Image";
import Card from "react-bootstrap/Card";
import { LoremIpsum } from "react-lorem-ipsum";

// text-center bg-secondary text-white my-5 py-4 border border-dark

const Resources = () => {
  return (
    // <Container
    //   style={{
    //     backgroundColor: "#FFDE00",
    //   }}
    //   className="border border-dark"
    //   // class="w-auto"
    // >
    <div className="py-3 bg-light">
      {/* <Card className="text-center my-3 py-2 border border-dark">
        <Card.Body>This is some text within a card body.</Card.Body>
      </Card> */}
      <Container className="py-5 border border-4 bg-dark">
        <p class="text-center text-white">
          <LoremIpsum
            p={1}
            avgWordsPerSentence={8}
            avgSentencesPerParagraph={4}
          />
        </p>
      </Container>
      <Container className="py-5 my-3 border border-4 bg-primary">
        <Row>
          <Col>
            <Card style={{ width: "18rem" }}>
              <Card.Img
                variant="top"
                src="https://picsum.photos/id/201/320/200"
              />
              <Card.Body>
                <Card.Title>Card Title</Card.Title>
                <Card.Text>
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
          </Col>

          <Col>
            <Card style={{ width: "18rem" }}>
              <Card.Img
                variant="top"
                src="https://picsum.photos/id/201/320/200"
              />
              <Card.Body>
                <Card.Title>Card Title</Card.Title>
                <Card.Text>
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
          </Col>

          <Col>
            <Card style={{ width: "18rem" }}>
              <Card.Img variant="top" src="holder.js/100px180" />
              <Card.Body>
                <Card.Title>Card Title</Card.Title>
                <Card.Text>
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>

    // </Container> "py-5 mt-5 bg-dark"
  );
};

export default Resources;
